import repository from "./Repository"
import Item from "../models/Item"

export default class QiitaRepository {
  async getItem(): Promise<any> {
    return repository.get(
        "/items",
        {
          params: {
            "page": "1",
            "per_page": "20",
            "query": "react",
          }
        }
    ).then((response) => { return response.data.map((x: any) => new Item(x))}
    )}
}
